import { useTheme } from "@mui/material";
import { FlexCol, H4, LoanStepper } from "../../components";

export const LoanApplication = () => {
  const theme = useTheme();
  const steps = [
    {
      name: "personal-details",
      label: "Personal Details",
      component: <></>,
    },
    {
      name: "loan-details",
      label: "Loan Details",
      component: <></>,
    },
    {
      name: "suggestions",
      label: "Loan Suggestions",
      component: <></>,
    },
  ];

  const handleSubmit = () => {};
  return (
    <FlexCol gap={2} padding={theme.spacing(2, 2)}>
      <H4>Apply For Loan</H4>
      <LoanStepper steps={steps} onSubmit={handleSubmit} alternativeLabel />
    </FlexCol>
  );
};
